==Galician==
===Pronunciation===
* {{IPA|gl|/ˈʃaβɾe̝/}}
===Etymology 1===
Probably from {{bor|gl|fro|sable}},<ref>{{R:es:DCECH|parar}}</ref> from {{der|gl|LL.|sablum}}, a variant form of {{inh|gl|la|sabulo|sabulō, sabulōnem|t=sand}}.
====Noun====
{{gl-noun|m}}
# [[sand]] (collectively, as a material)
# [[compacted]] [[soil]]
=====Synonyms=====
* {{sense|sand}} {{l|gl|area}}, {{l|gl|saibro}}
* {{sense|soil}} {{l|gl|sábrego}}
=====Related terms=====
* {{l|gl|jebra}}
===Etymology 2===
From {{bor|gl|fro|jable}},<ref>{{R:es:DCECH|jable}}</ref> from {{der|gl|LL.|gabulum}}, from {{der|gl|cel-pro|*gablo-|t=fork}}.
====Noun====
{{gl-noun|m}}
# [[slot]] in which the edges of the [[barrel]] lids are fitted
#: {{syn|gl|releixo}}
# any other similar [[slot]]
=====Derived terms=====
* {{l|gl|xabreiro}}
